import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

class FrontPage extends React.Component {
  constructor(props){
    super(props);
    this.state = {value:''};
    this.flowrate = {flowrateValue:''};


    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event){
    this.setState({value: event.target.value});
    this.setState({flowrateValue: event.target.flowrateValue});

  }

  handleSubmit(event) {
    alert('A stomach pressure was submitted: ' + this.state.value);
    alert('A flow rate was submitted: ' + this.flowrate.flowrateValue);

    event.preventDefault();
  }

  render() {
    return (
      <div>
        <br></br>
        <form onSubmit={this.handleSubmit}>
        <label>
        Enter baby stomach pressure:
          <input className="stomach-pressure" type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <br></br>
        <br></br>
        <label>
        Enter feed flow rate:
          <input className="flow-rate" type="text" value={this.flowrate.flowrateValue} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Submit" />
      </form>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <FrontPage />,
  document.getElementById('root')
);

